INSERT INTO `reports` VALUES ('customer name lookup','SELECT * FROM customers where customer_name like ?','customer_name','true'),('high-low rating in last 30 days','SELECT cr.product_id, p.model_name, ROUND (AVG(cr.rating_score),2) AS average_rating FROM customer_ratings cr RIGHT JOIN products p ON cr.product_id = p.product_id WHERE cr.review_date between (curdate() - interval 30 day) AND curdate() GROUP BY 1 HAVING average_rating <= 2.9 OR average_rating = 5 ORDER BY average_rating desc;',NULL,NULL),('inventory less than x','SELECT mi.product_item_id AS material_id, pbom.product_description AS material_description, mi.quantity FROM ProjectGroup5.manufacturer_inventory mi INNER JOIN ProjectGroup5.product_bom pbom ON mi.product_item_id = pbom.product_item_id WHERE mi.quantity <= ? AND pbom.quantity <= ?;','quantity,quantity','false,false'),('payment method mix','with totals as ( SELECT yearweek(co.order_date_local, 4) as order_week , sum(case when pm.payment_method = \'Cash\' then 1 else 0 end) as cash_count , sum(case when pm.payment_method = \'Check\' then 1 else 0 end) as check_count , sum(case when pm.payment_method = \'Apple Pay\' then 1 else 0 end) as apple_count , sum(case when pm.payment_method = \'Discover\' then 1 else 0 end) as discover_count , sum(case when pm.payment_method = \'American Express\' then 1 else 0 end) as amex_count , sum(case when pm.payment_method = \'Google Pay\' then 1 else 0 end) as google_count , sum(case when pm.payment_method = \'Master Card\' then 1 else 0 end) as master_count , sum(case when pm.payment_method = \'Paypal\' then 1 else 0 end) as paypal_count , sum(case when pm.payment_method = \'Venmo\' then 1 else 0 end) as venmo_count , sum(case when pm.payment_method = \'Visa\' then 1 else 0 end) as visa_count , count(*) as total_count FROM customer_orders co inner join payment_methods pm on co.payment_id = pm.payment_id GROUP BY 1 )\nSELECT order_week , cash_count / total_count as cash_mix , check_count / total_count as check_mix , apple_count / total_count as apple_mix , discover_count / total_count as discover_mix , amex_count / total_count as amex_mix , google_count / total_count as google_mix , master_count / total_count as master_mix , paypal_count / total_count as paypal_mix , venmo_count / total_count as venmo_mix , visa_count / total_count as visa_mix FROM totals ORDER BY 1;',NULL,NULL),('update cust info','update customers set phone = ? where customer_id = ?;','phone,customer_id','false,false'),('view cust info','SELECT * FROM customers ORDER BY customer_id',NULL,NULL);
/*!40000 ALTER TABLE `reports` ENABLE KEYS */;
